import React, { useEffect, useState } from 'react';
import axios from 'axios';

const TaskList = () => {
    const [tasks, setTasks] = useState([]);

    useEffect(() => {
        axios.get('/api/tasks/')
            .then(res => setTasks(res.data))
            .catch(err => console.log(err));
    }, []);

    return (
        <div>
            <h2>Task List</h2>
            <ul>
                {tasks.map(task => (
                    <li key={task.id}>
                        {task.title}
                        {task.completed ? " (Completed)" : ""}
                    </li>
                ))}
            </ul>
        </div>
    );
}

export default TaskList;
